&lt;/p&gt;
&lt;p style=&quot;font-size:14px;font-family:微软雅黑;color:#333333;background-color:#FFFFFF;&quot;&gt;
	2.咕币只适用于个人用途而进行的购物，不适用团体购物、以营利或销售为目的的购买行为、其他非个人用途购买行为;
&lt;/p&gt;
&lt;p style=&quot;font-size:14px;font-family:微软雅黑;color:#333333;background-color:#FFFFFF;&quot;&gt;
	3.咕币兑换标准及兑换规则均以兑换当时最新活动公告或目录为准，公告或目录如有有效期限的，逾期即不得兑换;
&lt;/p&gt;
&lt;p style=&quot;font-size:14px;font-family:微软雅黑;color:#333333;background-color:#FFFFFF;&quot;&gt;
	4.部分兑换商品有数量限制的，兑完为止。
&lt;/p&gt;
&lt;p style=&quot;font-size:14px;font-family:微软雅黑;color:#333333;background-color:#FFFFFF;&quot;&gt;
	违规处理：
