	&lt;span style=&quot;line-height:1.5;font-family:\'sans serif\', tahoma, verdana, helvetica;font-size:12px;&quot;&gt; &lt;/span&gt; 
&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:0pt;&quot;&gt;
	&lt;strong&gt;叮咕—寝室里的充饥神器&lt;/strong&gt; 
&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;text-indent:0pt;&quot;&gt;
	•&amp;nbsp;覆盖全国200多城市、2000余所高校
&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0pt;text-indent:0pt;&quot;&gt;
	•&amp;nbsp;饿了、渴了、馋了，就找叮咕，我们提供各种充饥、解馋、解渴类的美味零食饮品，史上最in、最贴心的5分钟送货“上床”服务，等你来约！
&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0pt;text-indent:0pt;&quot;&gt;
	•&amp;nbsp;固定营业时间：21:30-23:30（其他时间看心情）
&lt;/p&gt;
&lt;p class=&quot;p&quot; style=&quot;margin-left:0.0000pt;text-indent:0.0000pt;&quot;&gt;
	&lt;strong&gt;一、店长职责（2016年前免费申请，每栋宿舍楼仅限1&lt;/strong&gt;&lt;span&gt;&lt;strong&gt;名&lt;/strong&gt;&lt;/span&gt;&lt;strong&gt;）&lt;/strong&gt; 
&lt;/p&gt;
&lt;p class=&quot;p&quot; style=&quot;margin-left:0.0000pt;text-indent:0.0000pt;&quot;&gt;
	&lt;strong&gt;&lt;/strong&gt;&lt;span style=&quot;line-height:1.5;&quot;&gt;1、叮咕提供平台和解决底价成本货源，店长轻松经营一栋楼。&lt;/span&gt; 
&lt;/p&gt;
&lt;p class=&quot;p&quot; style=&quot;text-indent:0pt;&quot;&gt;
	2、学生线上下单后店长提供5分钟之内送货上门服务。
&lt;/p&gt;
&lt;p class=&quot;p&quot; style=&quot;text-indent:0pt;&quot;&gt;
	3、针对本栋楼做些必要的宣传，让大家知道本栋楼叮咕已入住，尝试适应运营过程中的细节，积累最前沿的店铺运营经验。
&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:0pt;text-indent:0pt;&quot;&gt;
	&lt;strong&gt;二、店长收入&lt;/strong&gt; 
&lt;/p&gt;
