&lt;/p&gt;
&lt;p style=&quot;font-family:Simsun;font-size:medium;&quot;&gt;
	七、&amp;nbsp;服务的中断和终止：
&lt;/p&gt;
&lt;p style=&quot;font-family:Simsun;font-size:medium;&quot;&gt;
